import React from 'react';
import {
    Link,
    useHistory
} from 'react-router-dom';
import Logo from '../Logo/Logo.js';
import './NavigationBar.css'

const NavigationBar = () => {
    const history = useHistory();
    return ( <
        div className = "flex justify-between-ns" >


        <
        div className = 'f3 dim black pa4 items-end' >
        <
        div className = "pa3 measure sunflower-light black pointer"
        onClick = {
            () => history.goBack()
        } >
        Back <
        /div> <
        Link className = "no-underline solid pa4 black items-end"
        to = '/' >

        Home <
        /Link> <
        Link className = "no-underline black items-end"
        to = '/comparecomponent' >
        Compare Reviews <
        /Link> <
        /div> <
        /div>
    );
}

export default NavigationBar;
